let abortController 
let abortSignal
var options = {{local.ceqocdl48i.payload.output.rawResponse.publicKeyCredentialRequestOptions}};

authenticate()
document.addEventListener("DOMContentLoaded", startPasskey())

function startPasskey() {
    document.getElementById('usernamelessForm').addEventListener("submit",abort)
    document.getElementById('submit').addEventListener('click', abort)
    document.getElementById('webAuthnLogin').addEventListener('click', abort)
    document.getElementById('webAuthnLogin').click= ()=>{
            abort()
            console.log("call authN")
            authenticate(true)
    }
    document.getElementById('webAuthnLogin').click()
    document.getElementById('usernamelessForm').submit
}

function abort(){
        console.debug('abort')
        if (abortController) {
                console.debug('abort')
                abortController.abort();
        }
}
document.getElementById('webAuthnLogin').click;
function authenticate(skipConditionalUi){
        abortController = new AbortController();
        abortSignal = abortController.signal;
        console.log("In Authenticsate")
        if (!skipConditionalUi && (!PublicKeyCredential.isConditionalMediationAvailable ||
        !PublicKeyCredential.isConditionalMediationAvailable()) &&
        !navigator.credentials.conditionalMediationSupported) {
        console.debug("Unsupported browser")
        return;
        }


        var publicKeyCredential = {};
        publicKeyCredential.challenge = new Uint8Array(options.challenge);
        if (options.allowCredentials && !options.allowCredentials != []) {
                console.warn("allowCredentials must be empty for Conditional UI")
                return
        }
        if ('rpId' in options) {
                publicKeyCredential.rpId = options.rpId;
        }
        if ('userVerification' in options) {
                publicKeyCredential.userVerification = options.userVerification;
        }


        console.debug("Options", publicKeyCredential);
        var request = {'signal': abortSignal, "publicKey": publicKeyCredential}
        if (!skipConditionalUi)
                request.mediation = 'conditional'

        navigator.credentials.get(request)
                .then(function (assertion) {
                        console.debug("Assertion", assertion);
                        // Send new credential info to server for verification and registration.
                        var publicKeyCredential = {};
                        if ('id' in assertion) {
                                publicKeyCredential.id = assertion.id;
                        }
                        if ('rawId' in assertion) {
                                publicKeyCredential.rawId = toBase64Str(assertion.rawId);
                        }
                        if ('type' in assertion) {
                                publicKeyCredential.type = assertion.type;
                        }
                        var response = {};
                        response.clientDataJSON = toBase64Str(assertion.response.clientDataJSON);
                        response.authenticatorData = toBase64Str(assertion.response.authenticatorData);
                        response.signature = toBase64Str(assertion.response.signature);
                        response.userHandle = toBase64Str(assertion.response.userHandle);
                        publicKeyCredential.response = response;
                        console.debug(JSON.stringify(publicKeyCredential))
                        document.getElementById("webauthbAssertion").value = JSON.stringify(publicKeyCredential);
                        document.getElementById("webauthnAuthenticatorAttachment").value = assertion.authenticatorAttachment;
                        document.getElementById('webAuthn').click();
                }).catch(function (err) {
                        // No acceptable authenticator or user refused consent. Cancel authentication
                        // if this is the only device so we don't loop
                        // console.error(err);
                        return;

        });
}

function toBase64Str(bin){
    return btoa(String.fromCharCode.apply(null, new Uint8Array(bin)));
}

